        if i < 0 or i >= len(grid) or j < 0 or (j >= len(grid[0])) or visited[i][j] or (abs(grid[i][j][0] - color[0]) > 20) or (abs(grid[i][j][1] - color[1]) > 20) or (abs(grid[i][j][2] - color[2]) > 20):
            return
        visited[i][j] = True
        dfs(grid, i + 1, j, color, visited)
        dfs(grid, i - 1, j, color, visited)
        dfs(grid, i, j + 1, color, visited)
        dfs(grid, i, j - 1, color, visited)
    distinct_objects = 0
    visited = [[False for _ in range(len(photo[1]))] for _ in range(len(photo))]
    for i in range(len(photo)):
        for j in range(len(photo[0])):
            if not visited[i][j]:
                dfs(photo, i, j, photo[i][j], visited)
                distinct_objects += 1
    return distinct_objects
